export default function CampoTexto(props) {

    //let valor = "Joao"
    const aoDigitado =(evento)=>{
        valor = evento.target.value
        console.log(valor)
    }
    return(
        <div className="campo_texto">
            <label>{props.label}</label>
            <input value={valor} onChange={aoDigitado} required={props.obrigatorio} type={props.type} placeholder= {`${props.placeholder}...`}/>
        </div>
    )
}
